class Solution(object):    def minPatches(self, nums, n):        """        :type nums: List[int]        :type n: int        :rtype: int        """        nums_sum=0        count=0        index=0        while nums_sum<n:            if index<len(nums) and nums[index]<=nums_sum+1:                nums_sum+=nums[index]                index+=1            else:                nums_sum+=nums_sum+1                count+=1        return countif __name__ == '__main__':    s=Solution()    s.minPatches([1,5,10],20)